from itertools import permutations

N = int(input())

def permutasi_zigzag(x):
    bucin = []
    for i in permutations(range(1, x+1), x):
        k = "".join(map(str, i))
        k_ = [int(k[p:p+3]) for p in range(x-2)]
        ok = 0
        for i in k_:
            a = i//100
            b = i//10-10*a
            c = i%10
            if (b<a and b<c) or (b>a and b>c):
                ok += 1
        if ok == len(k_):
            bucin.append(k)
    for j in bucin:
        print(j)
    
permutasi_zigzag(N)



